        // console.log("props1",props);
        const serverURL = `http://localhost:3005/getMovies`
        const response = await fetch(serverURL);
        const data = await response.json();
        console.log(data)
        setFavArr(data);
    }

    useEffect(() => {
        addFavoriteHandel();
    }, [])

